            <button className="select_button_Container"
                style={{
                    marginLeft:"2px",
                    cursor: "pointer", // 클릭시 글자색 흰색
                    fontSize:"13px",
                }}>
                개설과목 조회
            </button>

            <button className="select_button_Container"
                style={{
                    marginLeft:"2px",
                    cursor: "pointer",// 클릭시 글자색 흰색
                    fontSize:"13px",
                }}>
                개인강의시간표
            </button>
        </div>
        <div style={{    
            borderBottom: "1px solid black",
            lineHeight: "0.1em",
                width:"1180px",
                marginLeft: "312px",
                }}/>
    </div>

    );
}
